import Subjects from '../components/home/Subjects';
import Testimonials from '../components/home/Testimonials'

import 'bootstrap/dist/css/bootstrap.min.css'
import '../assets/css/home/General.css'

const App = () => (
    <div className="App">
        <HeaderHome />
        <BannerHome />
        <Userbenefits />
    </div>
);

export default App;
